import React from 'react'
import styled from 'styled-components'
import iconCgv from '../../assets/images/icon-cgv.png'

export const IconCgv = () => {
   return (
      <ImageS src={iconCgv} alt="..." className="icon-cgv" />
   )
}

export default IconCgv

const ImageS = styled.img`
   width:200px;
   height: 200px;
   border-radius: 50%;
`
